import React, { Component } from 'react';
import '../components/wrapper/mainSite';
import WebsiteLayout from '../components/wrapper/mainSite';
const ImageList = [
	{
		title: 'Relief Line (2016)',
		subtitle: 'Cancelled, replaced with Ontario Line',
		img: '/images/homepage/image1.png'
	},
	{ title: 'Metrolinx/Toronto Transit Plan (2011)', subtitle: '', img: 'images/homepage/image2.png' },
	{
		title: 'Transit City (2017)',
		subtitle: 'Cancelled, partially under construction',
		img: 'images/homepage/image3.png'
	},
	{ title: '', subtitle: '', img: 'images/homepage/image4.png' },
	{ title: '', subtitle: '', img: 'images/homepage/image5.png' },
	{ title: '', subtitle: '', img: 'images/homepage/image6.png' }
];
export default class App extends Component {
	render() {
		return (
			<WebsiteLayout>
				<div>App</div>
			</WebsiteLayout>
		);
	}
}
